UPDATE bus_bookings set assigned_by_agent_id = user_id, assigned_to_agent_id = to_user_id, assigned_comment = as_comment where id = booking_id;

WHEN booking_type = 3 THEN
UPDATE train_bookings set assigned_by_agent_id = user_id, assigned_to_agent_id = to_user_id, assigned_comment = as_comment where id = booking_id;

WHEN booking_type = 4 THEN
UPDATE hotel_bookings set assigned_by_agent_id = user_id, assigned_to_agent_id = to_user_id, assigned_comment = as_comment where id = booking_id;

WHEN booking_type = 5 THEN
UPDATE flight_bookings set assigned_by_agent_id = user_id, assigned_to_agent_id = to_user_id, assigned_comment = as_comment where id = booking_id;
END CASE;

END$$

