   SET taxi_invoice_amount = (SELECT COALESCE(SUM(sub_total),0) FROM taxi_booking_client_invoice WHERE booking_id in (select b.id from taxi_bookings `b` where b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id)));
