DROP PROCEDURE IF EXISTS `employeeHomePage`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `employeeHomePage` (IN `employee_id` INT)  BEGIN
	DECLARE total_bookings_count, taxi_bookings_count, bus_bookings_count, train_bookings_count, hotel_bookings_count, flight_bookings_count INT; 
	DECLARE uc_total_bookings_count, uc_taxi_bookings_count, uc_bus_bookings_count, uc_train_bookings_count, uc_hotel_bookings_count, uc_flight_bookings_count INT; 
	DECLARE tom_total_bookings_count, tom_taxi_bookings_count, tom_bus_bookings_count, tom_train_bookings_count, tom_hotel_bookings_count, tom_flight_bookings_count INT; 
	DECLARE pa_total_bookings_count, pa_taxi_bookings_count, pa_bus_bookings_count, pa_train_bookings_count, pa_hotel_bookings_count, pa_flight_bookings_count INT; 
	DECLARE pi_total_bookings_count, pi_taxi_bookings_count, pi_bus_bookings_count, pi_train_bookings_count, pi_hotel_bookings_count, pi_flight_bookings_count INT; 
	
   SET taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join employee_taxi_booking `pb` on pb.taxi_booking_id = b.id WHERE pb.employee_id = employee_id);
   
   SET bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` left join employee_bus_booking `pb` on pb.bus_booking_id = b.id WHERE pb.employee_id = employee_id);
   
   SET train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join employee_train_booking `pb` on pb.train_booking_id = b.id WHERE pb.employee_id = employee_id);
   
   SET hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join employee_hotel_booking `pb` on pb.hotel_booking_id = b.id WHERE pb.employee_id = employee_id);
   
   SET flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join employee_flight_booking `pb` on pb.flight_booking_id = b.id WHERE pb.employee_id = employee_id);
   
   SET total_bookings_count = taxi_bookings_count + bus_bookings_count + train_bookings_count + hotel_bookings_count + flight_bookings_count;
   
   SET uc_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join employee_taxi_booking `pb` on pb.taxi_booking_id = b.id WHERE pb.employee_id = employee_id and b.pickup_datetime > now() and b.status_cotrav IN(1,2,4));
   
   SET uc_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` left join employee_bus_booking `pb` on pb.bus_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_cotrav IN(1,2,4) and (b.pickup_from_datetime > now() OR b.pickup_to_datetime > now()));
   
   SET uc_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join employee_train_booking `pb` on pb.train_booking_id = b.id WHERE pb.employee_id = employee_id and (b.pickup_from_datetime > now() OR b.pickup_to_datetime > now()) and b.status_cotrav IN(1,2,4));
   
   SET uc_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join employee_hotel_booking `pb` on pb.hotel_booking_id = b.id WHERE pb.employee_id = employee_id and b.checkin_datetime > now() and b.status_cotrav IN(1,2,4));
   
   SET uc_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join employee_flight_booking `pb` on pb.flight_booking_id = b.id WHERE pb.employee_id = employee_id and b.departure_datetime > now() and b.status_cotrav IN(1,2,4));
   
   SET uc_total_bookings_count = uc_taxi_bookings_count + uc_bus_bookings_count + uc_train_bookings_count + uc_hotel_bookings_count + uc_flight_bookings_count;
   
   SET tom_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join employee_taxi_booking `pb` on pb.taxi_booking_id = b.id WHERE pb.employee_id = employee_id and b.pickup_datetime > now() and b.status_cotrav IN(1,2,4) and b.pickup_datetime > (CURDATE() + INTERVAL 1 DAY));
   
   SET tom_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` left join employee_bus_booking `pb` on pb.bus_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_cotrav IN(1,2,4) and (b.pickup_from_datetime > now() OR b.pickup_to_datetime > now()));
   
   SET tom_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join employee_train_booking `pb` on pb.train_booking_id = b.id WHERE pb.employee_id = employee_id and (b.pickup_from_datetime > now() OR b.pickup_to_datetime > now()) and b.status_cotrav IN(1,2,4) and b.pickup_from_datetime > (CURDATE() + INTERVAL 1 DAY));
   
   SET tom_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join employee_hotel_booking `pb` on pb.hotel_booking_id = b.id WHERE pb.employee_id = employee_id and b.checkin_datetime > now() and b.status_cotrav IN(1,2,4) and b.checkin_datetime > (CURDATE() + INTERVAL 1 DAY));
   
   SET tom_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join employee_flight_booking `pb` on pb.flight_booking_id = b.id WHERE pb.employee_id = employee_id and b.departure_datetime > now() and b.status_cotrav IN(1,2,4) and b.departure_datetime > (CURDATE() + INTERVAL 1 DAY));
   
   SET tom_total_bookings_count = tom_taxi_bookings_count + tom_bus_bookings_count + tom_train_bookings_count + tom_hotel_bookings_count + tom_flight_bookings_count;
   
   
   SET pa_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join employee_taxi_booking `pb` on pb.taxi_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_client=1);
   
   SET pa_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b`   left join employee_bus_booking `pb` on pb.bus_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_client=1);
   
   SET pa_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join employee_train_booking `pb` on pb.train_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_client=1);
   
   SET pa_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join employee_hotel_booking `pb` on pb.hotel_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_client=1);
   
   SET pa_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join employee_flight_booking `pb` on pb.flight_booking_id = b.id WHERE pb.employee_id = employee_id and b.status_client=1);
   
   SET pa_total_bookings_count = pa_taxi_bookings_count + pa_bus_bookings_count + pa_train_bookings_count + pa_hotel_bookings_count + pa_flight_bookings_count;
   
   SET pi_taxi_bookings_count = (SELECT COUNT(b.id) FROM taxi_bookings `b` left join employee_taxi_booking `pb` on pb.taxi_booking_id = b.id left join taxi_booking_client_invoice `i` on b.invoice_id = i.id  WHERE pb.employee_id = employee_id and b.is_invoice = 1 and i.status = 1);
   
   SET pi_bus_bookings_count = (SELECT COUNT(b.id) FROM bus_bookings `b` left join employee_bus_booking `pb` on pb.bus_booking_id = b.id left join bus_booking_client_invoice `i` on b.invoice_id = i.id WHERE pb.employee_id = employee_id and b.is_invoice = 1 and i.status = 1);
   
   SET pi_train_bookings_count = (SELECT COUNT(b.id) FROM train_bookings `b` left join employee_train_booking `pb` on pb.train_booking_id = b.id left join train_booking_client_invoice `i` on b.invoice_id = i.id  WHERE pb.employee_id = employee_id and b.is_invoice = 1 and i.status = 1);
   
   SET pi_hotel_bookings_count = (SELECT COUNT(b.id) FROM hotel_bookings `b` left join employee_hotel_booking `pb` on pb.hotel_booking_id = b.id left join hotel_booking_client_invoice `i` on b.invoice_id = i.id  WHERE pb.employee_id = employee_id and b.is_invoice = 1 and i.status = 1);
   
   SET pi_flight_bookings_count = (SELECT COUNT(b.id) FROM flight_bookings `b` left join employee_flight_booking `pb` on pb.flight_booking_id = b.id left join flight_booking_client_invoice `i` on b.invoice_id = i.id  WHERE pb.employee_id = employee_id and b.is_invoice = 1 and i.status = 1);
   
   SET pi_total_bookings_count = pi_taxi_bookings_count + pi_bus_bookings_count + pi_train_bookings_count + pi_hotel_bookings_count + pi_flight_bookings_count;
   
   
   SELECT total_bookings_count,taxi_bookings_count,bus_bookings_count,train_bookings_count,hotel_bookings_count,flight_bookings_count,uc_total_bookings_count,uc_taxi_bookings_count,uc_bus_bookings_count,uc_train_bookings_count,uc_hotel_bookings_count,uc_flight_bookings_count,tom_total_bookings_count,tom_taxi_bookings_count,tom_bus_bookings_count,tom_train_bookings_count,tom_hotel_bookings_count,tom_flight_bookings_count,pa_total_bookings_count,pa_taxi_bookings_count,pa_bus_bookings_count,pa_train_bookings_count,pa_hotel_bookings_count,pa_flight_bookings_count,pi_total_bookings_count,pi_taxi_bookings_count,pi_bus_bookings_count,pi_train_bookings_count,pi_hotel_bookings_count,pi_flight_bookings_count;

END$$

DROP PROCEDURE IF EXISTS `getAllAdminBusBookings`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getAllAdminBusBookings` (IN `corporate_id` INT, IN `booking_type` INT, IN `limit_from` INT, IN `limit_to` INT)  BEGIN
	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);
	
	SET curr_dt = (SELECT NOW());
	 	IF MONTH(curr_dt) in (4,5,6)
	THEN
		SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
	ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;  
SELECT b.*,DATE_FORMAT(b.pickup_from_datetime, '%d-%m-%Y %H:%i') as pickup_from_datetime,DATE_FORMAT(b.pickup_to_datetime, '%d-%m-%Y %H:%i') as pickup_to_datetime ,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,DATE_FORMAT(b.boarding_datetime, '%d-%m-%Y %H:%i') as boarding_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,spoc.email user_email,ca.user_name cotrav_agent_name,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id,bt.name bus_type_priority_1, bt2.name bus_type_priority_2, abt.name assign_bus_type_id, g.group_name, g.zone_name, sg.subgroup_name, ci.ticket_price, ci.management_fee, ci.tax_on_management_fee, ci.tax_on_management_fee_percentage, ci.sub_total, ci.igst, ci.cgst, ci.sgst, ci.management_fee_igst, ci.management_fee_cgst, ci.management_fee_sgst, ci.management_fee_igst_rate, ci.management_fee_cgst_rate, ci.management_fee_sgst_rate, ci.status invoice_status, ci.client_ticket,opr.operator_name, opr.operator_contact operator_contact,corp.corporate_name, cbe.entity_name
	from bus_bookings `b`
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN bus_types bt ON b.bus_type_priority_1 = bt.id
    LEFT JOIN bus_types bt2 ON b.bus_type_priority_1 = bt2.id
    LEFT JOIN bus_types abt ON b.bus_type_priority_1 = abt.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
	LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
	left join corporate_groups g on b.group_id = g.id
    left join corporate_subgroups sg on b.subgroup_id = sg.id
    left join bus_booking_client_invoice ci on b.id = ci.booking_id
    left join operators `opr` on b.operator_name = opr.id
    LEFT JOIN corporates corp ON b.corporate_id = corp.id
    LEFT JOIN corporate_billing_entities cbe ON b.billing_entity_id = cbe.id

WHERE

CASE 

WHEN booking_type = 1 THEN 
b.status_cotrav >= 4 AND b.corporate_id=corporate_id AND DATE_FORMAT(b.pickup_from_datetime, '%Y %m %d') LIKE DATE_FORMAT(NOW(), '%Y %m %d')
   
WHEN booking_type = 2 THEN 
b.status_cotrav IN(1,2) AND b.status_client IN(1,3,5,7,17,18) AND b.corporate_id=corporate_id AND DATE_SUB(NOW(), INTERVAL 12 HOUR) < b.pickup_from_datetime
    
    
WHEN booking_type = 3 THEN 
b.status_cotrav >= 4 AND b.status_client IN(1,3,5,7,17,18) AND b.corporate_id=corporate_id  AND DATE_SUB(NOW(), INTERVAL 12 HOUR) < b.pickup_from_datetime

WHEN booking_type = 4 THEN 
b.status_cotrav IN(1,2) AND b.status_client IN(1,3,5,7,17,18) AND b.corporate_id=corporate_id AND DATE_SUB(NOW(), INTERVAL 12 HOUR) > b.pickup_from_datetime
    
    
WHEN booking_type = 5 THEN 
b.status_cotrav >= 4 AND b.status_client IN(1,3,5,7,17,18) AND b.corporate_id=corporate_id AND DATE_SUB(NOW(), INTERVAL 12 HOUR) > b.pickup_from_datetime
    
    
WHEN booking_type = 6 THEN 
b.corporate_id=corporate_id AND (b.status_cotrav = 3 OR b.status_client IN(2,4,6,15,19))


WHEN booking_type = 15 THEN 
b.status_client IN(10)

WHEN booking_type = 16 THEN 
b.status_client IN(11)

WHEN booking_type = 17 THEN 
b.status_client IN(12)

END 

order by b.pickup_from_datetime LIMIT limit_from, limit_to;
	
END$$

