 b.status_client IN(3,5,17,18) AND b.subgroup_id in (select subgroup_id from corporate_subgroup_authenticater where id = approver_1_id)  AND DATE_SUB(NOW(), INTERVAL 12 HOUR) < b.pickup_from_datetime AND b.status_cotrav IN(1,2,4)

