CREATE DEFINER=`root`@`localhost` PROCEDURE `getAllApprover_2TaxiBookings` (IN `approver_2_id` INT, IN `booking_type` INT, IN `limit_from` INT, IN `limit_to` INT)  BEGIN
	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);

	SET curr_dt = (SELECT NOW());
		IF MONTH(curr_dt) in (4,5,6)
	THEN
		SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
	ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;
   
SELECT b.*,DATE_FORMAT(b.pickup_datetime, '%d-%m-%Y %H:%i') as pickup_datetime,DATE_FORMAT(b.booking_date, '%d-%m-%Y %H:%i') as booking_date, tt.name `taxi_type_name`,c.name `city_name`,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact, opr.operator_name, opr.operator_contact,ca.user_name cotrav_agent_name, csc.assessment_code as assessment_code, ac.city_name as assessment_city_id, corp.corporate_name, cbe.entity_name, tbci.id invoice_id,tbci.sub_total , od.driver_name, od.driver_contact
from taxi_bookings `b`
left join taxi_types `tt` on b.taxi_id = tt.id
    left join cities `c` on b.city_id = c.id
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join operators `opr` on b.operator_id = opr.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
	LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
	LEFT JOIN corporates corp ON b.corporate_id = corp.id
    LEFT JOIN corporate_billing_entities cbe ON b.billing_entity_id = cbe.id
    LEFT JOIN taxi_booking_client_invoice tbci ON b.invoice_id = tbci.id
    LEFT JOIN operator_drivers od ON b.driver_id = od.id
WHERE

CASE 

WHEN booking_type = 1 THEN 
b.status_cotrav IN(4) AND b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id) AND DATE_FORMAT(b.pickup_datetime, '%Y %m %d') LIKE DATE_FORMAT(NOW(), '%Y %m %d') 
   
WHEN booking_type = 2 THEN 
b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id) AND b.status_client IN(1) AND DATE_SUB(NOW(), INTERVAL 2 HOUR) < b.pickup_datetime 
WHEN booking_type = 3 THEN 
b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id) AND b.status_client IN(3,5,17,18) AND b.status_cotrav IN(1,2,4) AND b.status_client IN(3,5)  AND DATE_SUB(NOW(), INTERVAL 12 HOUR) < b.pickup_datetime 

WHEN booking_type = 4 THEN 
b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id) AND b.status_client IN(3,5,17,18) AND b.status_cotrav IN(1,2,4) AND DATE_SUB(NOW(), INTERVAL 12 HOUR) > b.pickup_datetime

WHEN booking_type = 5 THEN 
b.group_id in (select group_id from corporate_group_authenticator where id = approver_2_id) AND (b.status_cotrav=3 OR b.status_client IN(2,4,6,15,19)) 

END

order by b.pickup_datetime LIMIT limit_from, limit_to ;

END$$

