DROP PROCEDURE IF EXISTS `getAllOperatorBusBookings`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getAllOperatorBusBookings` (IN `operator_id` INT, IN `booking_type` INT)  BEGIN
	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);
	
	SET curr_dt = (SELECT NOW());
	   
   CASE booking_type
   
   WHEN 1 THEN 
SELECT b.*,DATE_FORMAT(b.pickup_from_datetime, '%d-%m-%Y %H:%i') as pickup_from_datetime,DATE_FORMAT(b.pickup_to_datetime, '%d-%m-%Y %H:%i') as pickup_to_datetime ,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,DATE_FORMAT(b.boarding_datetime, '%d-%m-%Y %H:%i') as boarding_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,ca.user_name cotrav_agent_name,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id,bt.name bus_type_priority_1, bt2.name bus_type_priority_2, abt.name assign_bus_type_id,opr.operator_name operator_name, opr.operator_contact operator_contact
	from bus_bookings `b`
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN bus_types bt ON b.bus_type_priority_1 = bt.id
    LEFT JOIN bus_types bt2 ON b.bus_type_priority_1 = bt2.id
    LEFT JOIN bus_types abt ON b.bus_type_priority_1 = abt.id
    left join operators `opr` on b.operator_name = opr.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
