	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);
	
	SET curr_dt = (SELECT NOW());
	   	IF MONTH(curr_dt) in (4,5,6)
	THEN
		SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
	ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;
SELECT b.*,DATE_FORMAT(b.pickup_from_datetime, '%d-%m-%Y %H:%i') as pickup_from_datetime,DATE_FORMAT(b.pickup_to_datetime, '%d-%m-%Y %H:%i') as pickup_to_datetime ,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,DATE_FORMAT(b.boarding_datetime, '%d-%m-%Y %H:%i') as boarding_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,spoc.email user_email,ca.user_name cotrav_agent_name,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id,bt.name bus_type_priority_1, bt2.name bus_type_priority_2, abt.name assign_bus_type_id, g.group_name, g.zone_name, sg.subgroup_name, ci.ticket_price, ci.management_fee, ci.tax_on_management_fee, ci.tax_on_management_fee_percentage, ci.sub_total, ci.igst, ci.cgst, ci.sgst, ci.management_fee_igst, ci.management_fee_cgst, ci.management_fee_sgst, ci.management_fee_igst_rate, ci.management_fee_cgst_rate, ci.management_fee_sgst_rate, ci.status invoice_status, ci.client_ticket,opr.operator_name, opr.operator_contact operator_contact,corp.corporate_name, cbe.entity_name
	from bus_bookings `b`
