DROP PROCEDURE IF EXISTS `getBookingsForPrevSixMonths`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getBookingsForPrevSixMonths` (IN `dt_date` DATE, IN `service_types` INT)  NO SQL
IF service_types = 1 THEN

SELECT YEAR(tb.pickup_datetime) AS y, MONTH(tb.pickup_datetime) AS m, CONVERT (COUNT(tb.id), UNSIGNED) as taxi_total
FROM taxi_bookings `tb` LEFT JOIN taxi_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.pickup_datetime < dt_date AND tb.pickup_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;

ELSEIF service_types = 2 THEN

SELECT YEAR(tb.boarding_datetime) AS y, MONTH(tb.boarding_datetime) AS m, CONVERT (COUNT(tb.id) , UNSIGNED) as bus_total
FROM bus_bookings `tb` LEFT JOIN bus_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.boarding_datetime < dt_date AND tb.boarding_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;

ELSEIF service_types = 3 THEN

SELECT YEAR(tb.boarding_datetime) AS y, MONTH(tb.boarding_datetime) AS m, CONVERT (COUNT(tb.id) , UNSIGNED) as train_total
FROM train_bookings `tb` LEFT JOIN train_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.boarding_datetime < dt_date AND tb.boarding_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;


ELSEIF service_types = 4 THEN

SELECT YEAR(tb.departure_datetime) AS y, MONTH(tb.departure_datetime) AS m, CONVERT (COUNT(tb.id) , UNSIGNED) as flight_total
FROM flight_bookings `tb` LEFT JOIN flight_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.departure_datetime < dt_date AND tb.departure_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;


ELSEIF service_types = 5 THEN

SELECT YEAR(tb.checkout_datetime) AS y, MONTH(tb.checkout_datetime) AS m, CONVERT (COUNT(tb.id) , UNSIGNED)as hotel_total
FROM hotel_bookings `tb` LEFT JOIN hotel_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.checkout_datetime < dt_date AND tb.checkout_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;



END IF$$

DROP PROCEDURE IF EXISTS `getCityId`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getCityId` (IN `search_string` VARCHAR(255))  NO SQL
BEGIN

DECLARE city_str varchar(255) DEFAULT '';

DECLARE state_str varchar(255) DEFAULT '';

DECLARE country_str varchar(255) DEFAULT '';

DECLARE country_id INT DEFAULT 0;

DECLARE state_id INT DEFAULT 0;

DECLARE city_id INT DEFAULT 0;

IF search_string = '' THEN

SELECT 0;

ELSE

SELECT SUBSTRING_INDEX(search_string , ',', 1) INTO @city_str;

SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(search_string , ',', 2),',',-1) INTO @state_str;

SELECT SUBSTRING_INDEX(search_string , ',', -1) INTO @country_str;

IF EXISTS(SELECT id FROM countries WHERE name = @country_str) THEN

SELECT id FROM countries WHERE name = @country_str INTO @country_id;

ELSE
        SELECT id FROM countries WHERE name = @country_str INTO @country_id;
       
END IF;



IF EXISTS(SELECT id FROM states WHERE name = @state_str) THEN

SELECT id FROM states WHERE name = @state_str INTO @state_id;

ELSE
        SELECT id FROM states WHERE name = @state_str INTO @state_id;
       
END IF;



IF EXISTS(SELECT id FROM cities WHERE name = @city_str) THEN

SELECT id FROM cities WHERE name = @city_str;

ELSE
        SELECT id FROM cities WHERE name = @city_str;
       
END IF;


END IF;



END$$

