DROP PROCEDURE IF EXISTS `getSalesForPrevSixMonths`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getSalesForPrevSixMonths` (IN `dt_date` DATE, IN `service_types` INT)  NO SQL
IF service_types = 1 THEN

SELECT YEAR(tb.pickup_datetime) AS y, MONTH(tb.pickup_datetime) AS m, CONVERT (SUM(tbcl.sub_total)/10000, UNSIGNED) as taxi_total
FROM taxi_bookings `tb` LEFT JOIN taxi_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.pickup_datetime < dt_date AND tb.pickup_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;

ELSEIF service_types = 2 THEN

SELECT YEAR(tb.boarding_datetime) AS y, MONTH(tb.boarding_datetime) AS m, CONVERT (SUM(tbcl.sub_total)/10000, UNSIGNED) as bus_total
FROM bus_bookings `tb` LEFT JOIN bus_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.boarding_datetime < dt_date AND tb.boarding_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;

ELSEIF service_types = 3 THEN

SELECT YEAR(tb.boarding_datetime) AS y, MONTH(tb.boarding_datetime) AS m, CONVERT (SUM(tbcl.sub_total)/10000 , UNSIGNED) as train_total
FROM train_bookings `tb` LEFT JOIN train_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.boarding_datetime < dt_date AND tb.boarding_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;


ELSEIF service_types = 4 THEN

SELECT YEAR(tb.departure_datetime) AS y, MONTH(tb.departure_datetime) AS m, CONVERT (SUM(tbcl.sub_total)/10000 , UNSIGNED) as flight_total
FROM flight_bookings `tb` LEFT JOIN flight_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.departure_datetime < dt_date AND tb.departure_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;


ELSEIF service_types = 5 THEN

SELECT YEAR(tb.checkout_datetime) AS y, MONTH(tb.checkout_datetime) AS m, CONVERT (SUM(tbcl.sub_total)/10000 , UNSIGNED)as hotel_total
FROM hotel_bookings `tb` LEFT JOIN hotel_booking_client_invoice `tbcl` ON tb.id = tbcl.booking_id where tb.checkout_datetime < dt_date AND tb.checkout_datetime > (SELECT DATE_SUB( dt_date , INTERVAL 6 MONTH))
GROUP BY y, m;



