DROP PROCEDURE IF EXISTS `getTaxableDataForDashboard`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `getTaxableDataForDashboard` (IN `service_types` INT, IN `from_date` DATE, IN `to_date` DATE)  NO SQL
IF service_types = 1 THEN

SELECT  CONVERT (SUM(b.base_rate), UNSIGNED) as pre_tax_amount , CONVERT (SUM(b.igst_amount), UNSIGNED) as igst ,CONVERT (SUM(b.cgst_amount), UNSIGNED) as cgst ,CONVERT (SUM(b.sgst_amount), UNSIGNED) as sgst,CONVERT (( SUM(b.base_rate) + SUM(b.igst_amount) + SUM(b.cgst_amount) + SUM(b.sgst_amount) ),UNSIGNED ) as total , CONVERT (( SUM(b.base_rate) + SUM(b.extra_hr_charges) + SUM(b.extra_km_charges) + SUM(b.driver_allowance) + SUM(b.other_charges) ),UNSIGNED ) as other_charge
FROM taxi_bookings `a` LEFT JOIN taxi_booking_client_invoice `b` ON a.id = b.booking_id where (a.pickup_datetime < to_date) AND (a.pickup_datetime > from_date);



ELSEIF service_types = 2 THEN

SELECT  CONVERT (SUM(b.ticket_price), UNSIGNED) as pre_tax_amount , CONVERT (SUM(b.igst), UNSIGNED) as igst ,CONVERT (SUM(b.cgst), UNSIGNED) as cgst ,CONVERT (SUM(b.sgst), UNSIGNED) as sgst , CONVERT (( SUM(b.ticket_price) + SUM(b.igst) + SUM(b.cgst) + SUM(b.sgst) ),UNSIGNED ) as total 
FROM bus_bookings `a` LEFT JOIN bus_booking_client_invoice `b` ON a.id = b.booking_id where (a.boarding_datetime < to_date) AND (a.boarding_datetime > from_date) ;


ELSEIF service_types = 3 THEN

SELECT CONVERT (SUM(b.ticket_price), UNSIGNED) as pre_tax_amount , CONVERT (SUM(b.igst), UNSIGNED) as igst ,CONVERT (SUM(b.cgst), UNSIGNED) as cgst ,CONVERT (SUM(b.sgst), UNSIGNED) as sgst , CONVERT (( SUM(b.ticket_price) + SUM(b.igst) + SUM(b.cgst) + SUM(b.sgst) ),UNSIGNED ) as total 
FROM train_bookings `a` LEFT JOIN train_booking_client_invoice `b` ON a.id = b.booking_id where (a.boarding_datetime < to_date) AND (a.boarding_datetime > from_date);



ELSEIF service_types = 4 THEN

SELECT CONVERT (SUM(b.ticket_price), UNSIGNED) as pre_tax_amount , CONVERT (SUM(b.igst), UNSIGNED) as igst ,CONVERT (SUM(b.cgst), UNSIGNED) as cgst ,CONVERT (SUM(b.sgst), UNSIGNED) as sgst , CONVERT (( SUM(b.ticket_price) + SUM(b.igst) + SUM(b.cgst) + SUM(b.sgst) ),UNSIGNED ) as total 
FROM flight_bookings `a` LEFT JOIN flight_booking_client_invoice `b` ON a.id = b.booking_id where (a.departure_datetime < to_date) AND (a.departure_datetime > from_date);



ELSEIF service_types = 5 THEN

