DROP PROCEDURE IF EXISTS `OperatorHomePage`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `OperatorHomePage` (IN `operator_id` INT)  NO SQL
BEGIN
DECLARE rate_count, bank_count, contact_count, driver_count, total_booking_count INT;

DECLARE taxi_booking_count, bus_booking_count, train_booking_count, hotel_booking_count, flight_booking_count INT;

SET rate_count = (SELECT count(id) FROM operator_rates WHERE id = operator_id );
SET bank_count = (SELECT count(id) FROM operator_bank_accounts WHERE id = operator_id );
SET contact_count = (SELECT count(id) FROM operator_contacts WHERE id = operator_id );
SET driver_count = (SELECT count(id) FROM operator_drivers WHERE id = operator_id );

SET taxi_booking_count = (SELECT count(id) FROM taxi_bookings b WHERE b.operator_id = operator_id );
SET bus_booking_count = (SELECT count(id) FROM bus_bookings b WHERE b.operator_name = operator_id );
SET hotel_booking_count = (SELECT count(id) FROM hotel_bookings b WHERE b.assign_hotel_id = operator_id );
SET flight_booking_count = (SELECT count(id) FROM flight_bookings b WHERE b.vendor_id = operator_id );

SET total_booking_count = taxi_booking_count + bus_booking_count  + hotel_booking_count + flight_booking_count;

SELECT rate_count, bank_count, contact_count, driver_count, total_booking_count ,taxi_booking_count, bus_booking_count, train_booking_count, hotel_booking_count, flight_booking_count,total_booking_count;

END$$

