DROP PROCEDURE IF EXISTS `reportAgentsTaxiBookings`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `reportAgentsTaxiBookings` (IN `filter_by` INT, IN `from_date` DATE, IN `to_date` DATE, IN `booking_status` INT, IN `company_name` INT)  NO SQL
SELECT b.*,DATE_FORMAT(b.pickup_datetime, '%d-%m-%Y %H:%i') as pickup_datetime,DATE_FORMAT(b.booking_date, '%d-%m-%Y %H:%i') as booking_date, tt.name `taxi_type_name`,c.name `city_name`,bs.status AS client_status,cs.status AS cotrav_status,spoc.user_name,spoc.user_contact,spoc.email, opr.operator_name, opr.operator_contact,ca.user_name cotrav_agent_name,cr.package_name,cr.base_rate,od.driver_name,od.driver_contact,od.licence_no,od.driver_email, csc.assessment_code as assessment_code, ac.city_name as assessment_city_id , c.name as city_name , crp_grp.group_name as group_name , crp_sgrp.subgroup_name as subgroup_name , spoc.user_name as spoc_name , 
		tbci.bb_entity as ci_bb_entity ,tbci.cotrav_billing_entity as ci_cotrav_billing_entity , 
		tbci.management_fee as ci_management_fee ,
		tbci.tax_on_management_fee as ci_tax_on_management_fee, 
		tbci.tax_on_management_fee_percentage as ci_tax_on_management_fee_percentage,
		tbci.management_fee_igst as ci_management_fee_igst , 
		tbci.management_fee_cgst as ci_management_fee_cgst , tbci.management_fee_sgst AS ci_management_fee_sgst ,
		tbci.management_fee_igst_rate as ci_management_fee_igst_rate , 
		tbci.management_fee_cgst_rate AS ci_management_fee_cgst_rate , 
		tbci.management_fee_sgst_rate as ci_management_fee_sgst_rate ,
		tbci.igst as ci_igst , 
		tbci.cgst as ci_cgst , tbci.sgst as ci_sgst , 
		tbci.igst_amount as ci_igst_amount ,
		tbci.cgst_amount as ci_cgst_amount ,
		tbci.sgst_amount as ci_sgst_amount ,
		tbci.hours_done as ci_hours_done , tbci.allowed_hours as ci_allowed_hours , tbci.extra_hours as ci_extra_hours ,
		tbci.charge_hour as ci_charge_hour , tbci.days as ci_days , tbci.start_km as ci_start_km ,
		tbci.end_km as ci_end_km , tbci.kms_done as ci_kms_done , tbci.allowed_kms as ci_allowed_kms ,
		tbci.extra_kms as ci_extra_kms , tbci.extra_km_rate as ci_extra_km_rate , tbci.base_rate as ci_base_rate ,
		tbci.extra_hr_charges as ci_extra_hr_charges , tbci.extra_km_charges as ci_extra_km_charges , 
		tbci.driver_allowance as ci_driver_allowance , tbci.total_excluding_tax as ci_total_excluding_tax ,
		tbci.other_charges as ci_other_charges , tbci.total as ci_total ,
		tbci.sub_total as ci_sub_total , tbci.radio_rate as ci_radio_rate ,
		tbci.status as ci_status , tbci.client_status as ci_client_status 

from taxi_bookings `b`
    left join taxi_types `tt` on b.taxi_id = tt.id
    left join cities `c` on b.city_id = c.id
    left join status_client `sc` on b.status_client = sc.id
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join operators `opr` on b.operator_id = opr.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN corporate_rates `cr` ON b.rate_id = cr.id
    LEFT JOIN operator_drivers `od` ON b.driver_id = od.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
    LEFT JOIN corporate_groups `crp_grp` ON b.group_id = crp_grp.id
    
    LEFT JOIN corporate_subgroups `crp_sgrp` ON b.subgroup_id = crp_sgrp.id
    
LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id

LEFT JOIN taxi_booking_client_invoice tbci ON b.id = tbci.booking_id

