DROP PROCEDURE IF EXISTS `updateFcmRegID`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateFcmRegID` (IN `user_id` INT, IN `user_type` INT, IN `fcm_regid` VARCHAR(255))  NO SQL
BEGIN

IF user_type = 10 THEN
	SELECT ca.* from corporate_agents ca WHERE ca.email = user_name LIMIT 1;
    
ELSEIF user_type = 1 THEN
    UPDATE corporate_logins cl SET cl.fcm_regid = fcm_regid WHERE cl.id = user_id;
    
ELSEIF user_type = 2 THEN
    UPDATE corporate_subgroup_authenticater ga SET ga.fcm_regid = fcm_regid WHERE ga.id = user_id;
    
ELSEIF user_type = 3 THEN
    UPDATE corporate_group_authenticator ca SET ca.fcm_regid = fcm_regid WHERE ca.id = user_id;
    
ELSEIF user_type = 4 THEN
    UPDATE corporate_spocs ca SET ca.fcm_regid = fcm_regid WHERE ca.id = user_id;
    
ELSEIF user_type = 6 THEN
UPDATE corporate_employees ca SET ca.fcm_regid = fcm_regid WHERE ca.id = user_id;
    
END IF;
END$$

