DROP PROCEDURE IF EXISTS `updateTrainBookingStatus`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `updateTrainBookingStatus` (IN `status_id` INT, IN `user_comment` VARCHAR(255), IN `booking_id` INT)  NO SQL
BEGIN

CASE 

WHEN status_id = 2 THEN
UPDATE train_bookings b SET b.status_cotrav = 2, b.assigned_comment=user_comment WHERE b.id = booking_id;

WHEN status_id = 8 THEN
UPDATE train_bookings b SET b.status_cotrav = 17, b.assigned_comment=user_comment WHERE b.id = booking_id;

WHEN status_id = 9 THEN
UPDATE train_bookings b SET b.status_cotrav = 18, b.assigned_comment=user_comment WHERE b.id = booking_id;

END CASE;

END$$

