DROP PROCEDURE IF EXISTS `viewBusBooking`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `viewBusBooking` (IN `booking_id` INT)  BEGIN
	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);
	
	SET curr_dt = (SELECT NOW());
	
	IF MONTH(curr_dt) in (4,5,6)
	THEN
		SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
	ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;
   
	SELECT b.*,DATE_FORMAT(b.pickup_from_datetime, '%d-%m-%Y %H:%i') as pickup_from_datetime,DATE_FORMAT(b.pickup_to_datetime, '%d-%m-%Y %H:%i') as pickup_to_datetime ,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,DATE_FORMAT(b.boarding_datetime, '%d-%m-%Y %H:%i') as boarding_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_cid,spoc.user_name,spoc.user_contact,spoc.email user_email,spoc.fcm_regid spoc_fcm_reg_id,spoc.is_send_email spoc_is_send_email,spoc.is_send_sms spoc_is_send_sms,ca.user_name cotrav_agent_name,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id,bt.name bus_type_priority_1, bt2.name bus_type_priority_2, abt.name assign_bus_type_id, g.group_name, g.zone_name, sg.subgroup_name, ci.ticket_price, ci.management_fee, ci.tax_on_management_fee, ci.tax_on_management_fee_percentage, ci.sub_total, ci.igst, ci.cgst, ci.sgst, ci.management_fee_igst, ci.management_fee_cgst, ci.management_fee_sgst, ci.management_fee_igst_rate, ci.management_fee_cgst_rate, ci.management_fee_sgst_rate, ci.status invoice_status, ci.client_ticket,opr.operator_name, opr.operator_contact operator_contact, vi.ticket_price vi_ticket_price, vi.vender_commission , vi.igst vi_igst, vi.cgst vi_cgst, vi.sgst vi_sgst,cs1.status invoice_status_cotrav, cs2.status invoice_status_client, ci.cotrav_billing_entity
	from bus_bookings `b`
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN bus_types bt ON b.bus_type_priority_1 = bt.id
    LEFT JOIN bus_types bt2 ON b.bus_type_priority_1 = bt2.id
    LEFT JOIN bus_types abt ON b.bus_type_priority_1 = abt.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
	LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
	left join corporate_groups g on b.group_id = g.id
    left join corporate_subgroups sg on b.subgroup_id = sg.id
    left join bus_booking_client_invoice ci on b.id = ci.booking_id
    left join operators `opr` on b.operator_name = opr.id
    LEFT JOIN bus_booking_vender_invoice vi ON b.id = vi.booking_id
    left join status_client `cs1` on cs1.id = ci.status
    left join status_client `cs2` on cs2.id = ci.client_status
	where b.status_cotrav >= 1 AND ((b.pickup_from_datetime between from_date and to_date) OR b.is_invoice = 0 ) AND b.id = booking_id order by b.boarding_datetime;
END$$

