DROP PROCEDURE IF EXISTS `viewTaxiBooking`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `viewTaxiBooking` (IN `booking_id` INT)  NO SQL
BEGIN

SELECT b.*,DATE_FORMAT(b.pickup_datetime, '%d-%m-%Y %H:%i') as pickup_datetime,DATE_FORMAT(b.booking_date, '%d-%m-%Y %H:%i') as booking_date, tt.name `taxi_type_name`, ttt.name `taxi_type_request`,c.name `city_name`,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_cid,spoc.user_name,spoc.user_contact,spoc.email user_email,spoc.fcm_regid spoc_fcm_reg_id,spoc.is_send_email spoc_is_send_email,spoc.is_send_sms spoc_is_send_sms, opr.operator_name, opr.operator_contact,ca.user_name cotrav_agent_name,cr.package_name,cr.kms,cr.hours,cr.km_rate,cr.hour_rate,cr.base_rate,cr.night_rate,od.driver_name driver_name,od.driver_contact,od.licence_no,od.driver_email,tm.brand_name,tm.model_name,t.taxi_reg_no,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id, g.group_name, g.zone_name, sg.subgroup_name, ci.management_fee, ci.tax_on_management_fee, ci.tax_on_management_fee_percentage, ci.sub_total, ci.igst, ci.cgst, ci.sgst, ci.management_fee_igst, ci.management_fee_cgst, ci.management_fee_sgst, ci.management_fee_igst_rate, ci.management_fee_cgst_rate, ci.management_fee_sgst_rate, ci.status invoice_status, ci.hours_done, ci.allowed_hours, ci.extra_hours, ci.charge_hour, ci.days, ci.start_km, ci.end_km, ci.kms_done, ci.allowed_kms, ci.extra_kms, ci.extra_km_rate, ci.base_rate i_base_rate, ci.extra_hr_charges, ci.extra_km_charges, ci.driver_allowance, ci.total_excluding_tax, ci.other_charges, ci.total, ci.sub_total, ci.radio_rate, cs1.status invoice_status_cotrav, cs2.status invoice_status_client, ci.cotrav_billing_entity, op_r.package_name o_package_name, op_r.kms o_kms, op_r.hours o_hours, op_r.km_rate o_km_rate, op_r.hour_rate o_hour_rate, op_r.base_rate o_base_rate, op_r.night_rate o_night_rate, vi.ticket_price vi_ticket_price, vi.vender_commission , vi.igst vi_igst, vi.cgst vi_cgst, vi.sgst vi_sgst
	from taxi_bookings `b`
	left join taxi_types `tt` on b.taxi_id = tt.id
    left join taxi_types `ttt` on b.taxi_type = ttt.id
    left join cities `c` on b.city_id = c.id
    left join status_client `sc` on b.status_client = sc.id
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join operators opr on b.operator_id = opr.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    LEFT JOIN corporate_rates cr ON b.rate_id = cr.id
    LEFT JOIN operator_drivers od ON b.driver_id = od.id
    LEFT JOIN taxis t ON b.taxi_id = t.id
    LEFT JOIN taxi_models tm ON t.taxi_model_id = tm.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
    left join corporate_groups g on b.group_id = g.id
    left join corporate_subgroups sg on b.subgroup_id = sg.id
    left join taxi_booking_client_invoice ci on b.id = ci.booking_id
    left join status_client `cs1` on cs1.id = ci.status
    left join status_client `cs2` on cs2.id = ci.client_status
	LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
LEFT JOIN operator_rates op_r ON b.operator_package_id = op_r.id
LEFT JOIN taxi_booking_vender_invoice vi ON b.id = vi.booking_id
    WHERE b.id = booking_id;

END$$

DROP PROCEDURE IF EXISTS `viewTrainBooking`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `viewTrainBooking` (IN `booking_id` INT)  BEGIN
	DECLARE curr_dt DATETIME;
	DECLARE qrt,from_date,to_date varchar(20);
	
	SET curr_dt = (SELECT NOW());
	
	IF MONTH(curr_dt) in (4,5,6)
	THEN
		SET from_date = CONCAT(YEAR(curr_dt),'-04-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-06-30 23:59:59');
   ELSEIF MONTH(curr_dt) in (7,8,9)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-07-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-09-30 23:59:59');
	ELSEIF MONTH(curr_dt) in (10,11,12)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-10-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-12-31 23:59:59');
	ELSEIF MONTH(curr_dt) in (1,2,3)
   THEN
   	SET from_date = CONCAT(YEAR(curr_dt),'-','-01-01');
		SET to_date = CONCAT(YEAR(curr_dt),'-03-31 23:59:59');
   END IF;
   
	SELECT b.*,DATE_FORMAT(b.pickup_from_datetime, '%d-%m-%Y %H:%i') as pickup_from_datetime,DATE_FORMAT(b.pickup_to_datetime, '%d-%m-%Y %H:%i') as pickup_to_datetime ,DATE_FORMAT(b.booking_datetime, '%d-%m-%Y %H:%i') as booking_datetime,DATE_FORMAT(b.boarding_datetime, '%d-%m-%Y %H:%i') as boarding_datetime,bs.status `client_status`,cs.status `cotrav_status`,spoc.user_name,spoc.user_contact,spoc.email user_email,spoc.fcm_regid spoc_fcm_reg_id,spoc.is_send_email spoc_is_send_email,spoc.is_send_sms spoc_is_send_sms,ca.user_name cotrav_agent_name, CONCAT(rs.station_name,' (',rs.station_code,' )')  drop_location, CONCAT(rs1.station_name,' (',rs1.station_code,' )') pickup_location,csc.assessment_code as assessment_code, ac.city_name as assessment_city_id,bt.name train_type_priority_1, bt2.name train_type_priority_2, abt.name assign_bus_type_id, g.group_name, g.zone_name, sg.subgroup_name, ci.ticket_price, ci.management_fee, ci.tax_on_management_fee, ci.tax_on_management_fee_percentage, ci.sub_total, ci.igst, ci.cgst, ci.sgst, ci.management_fee_igst, ci.management_fee_cgst, ci.management_fee_sgst, ci.management_fee_igst_rate, ci.management_fee_cgst_rate, ci.management_fee_sgst_rate, spoc.user_cid,cs1.status invoice_status_cotrav, cs2.status invoice_status_client, ci.cotrav_billing_entity
	from train_bookings `b`
    left join status_client `bs` on b.status_client = bs.id
    left join status_cotrav `cs` on b.status_cotrav = cs.id
    left join corporate_spocs `spoc` on b.spoc_id = spoc.id
    left join corporate_agents `ca` on b.last_action_by = ca.id
    left join railway_stations rs on b.drop_location = rs.id
    left join railway_stations rs1 on b.pickup_location = rs1.id
    LEFT JOIN train_types bt ON b.train_type_priority_1 = bt.id
    LEFT JOIN train_types bt2 ON b.train_type_priority_2 = bt2.id
    LEFT JOIN train_types abt ON b.assign_bus_type_id = abt.id
    LEFT JOIN corporate_assessment_codes csc ON b.assessment_code = csc.id
	LEFT JOIN corporate_assessment_cities ac ON b.assessment_city_id = ac.id
    left join corporate_groups g on b.group_id = g.id
    left join corporate_subgroups sg on b.subgroup_id = sg.id
    LEFT JOIN train_booking_client_invoice ci ON b.id = ci.booking_id
    left join status_client `cs1` on cs1.id = ci.status
    left join status_client `cs2` on cs2.id = ci.client_status
	where b.status_cotrav >= 1 AND ((b.pickup_from_datetime between from_date and to_date) OR b.is_invoice = 0 ) AND b.id = booking_id order by b.boarding_datetime;
END$$

